$('document').ready(function(){
    $('.brand-slider').slick({
        slidesToShow: 5,
        slidesToScroll: 1,
        arrows: false,
        autoplay: false,
        dots: false,
        responsive: [{
            breakpoint: 1199,
            settings: {
                slidesToShow: 2,
                slidesToScroll: 1,
                infinite: true,
                dots: false,
                arrows: false,
                autoplay: false,
            }
        }]
    });
});    

alert("hello");
//настройки гугл карты
// google.maps.event.addDomListener(window, 'load', init);
function init() {
    alert("hello");
    var locations = [
        ["Луцк, ул.Набережная, 10", 50.7478993, 25.3171627, "img/ico_marker.png"],
    ];
    var map = new google.maps.Map(document.getElementById('map'), {
        zoom: 16,
		minZoom: 4,
		maxZoom: 18,
		zoomControl:true,
		zoomControlOptions: {
			style:google.maps.ZoomControlStyle.DEFAULT 
		},
		center: {lat: 50.7478993, lng: 25.3171627},
        mapTypeId: google.maps.MapTypeId.ROADMAP,
		scrollwheel: false,
    	panControl:false, 
    	mapTypeControl:false,
    	scaleControl:false,
    	streetViewControl:false,
    	overviewMapControl:false,
    	rotateControl:false
    });
      
    var infowindow = new google.maps.InfoWindow();
    var marker, i;
      
    for (i = 0; i < locations.length; i++) {
        marker = new google.maps.Marker({
            position: new google.maps.LatLng(locations[i][1], locations[i][2]),
            map: map,
            icon: {
                url: locations[i][3],
                scaledSize: new google.maps.Size(22, 35)
            }
        });
        google.maps.event.addListener(marker, 'click', (function(marker, i) {
            return function() {
                infowindow.setContent(locations[i][0]);
                infowindow.open(map, marker);
            }
        })(marker, i));
    }
}


$('document').ready(function(){
	
	//настройки Fancybox
	
	$(".fancybox").fancybox({
		helpers: {
			overlay: {
				locked: false
			}
		},
		openEffect	: 'none',
		closeEffect	: 'none',
		padding: 0
	});
	
	// настройки попапов
	
	$('.modal-show-btn').fancybox({
        autoSize: true,
        type: 'inline',
        closeBtn: true,
        padding: 0,
        scrolling: 'visible',
        fixed: false,
        autoCenter: false,
        beforeShow: function() {
            $('input').removeClass('error');
            $('input[type="text"]').val('');
            $('textarea').val('');
            $(".fancybox-skin").css("background-color", "transparent");

            if(this.element.hasClass('order-link')){
                $('#order-modal [name="from"]').val(this.element.data('from'));
            }


        },
        afterShow: function(){

        },
        beforeClose: function(){

        },
        afterClose: function() {

        }
    }).click(function() {
        if (typeof($(this).data('from')) !== 'undefined') {

        }
    });
	
	//кнопка закрытия попапов
	
	$('.modal-close-btn').click(function() {
        $.fancybox.close();
        return false;
    });
	
	//кнопка отправки формы
  	
	$('body').on('click', '.send-btn', function(){
        $(this).parents('form').submit();
    });
	
	//валидация формы
	
	$('form').submit(function() {
        $(this).isCorrectRequest();
        return false;
    });
	
	(function($) {
		$.fn.isCorrectRequest = function() {
			this.find('input[type=text]').removeClass('correct error');

			var nameInput = $(this).find('[name = "name"]');
			var phoneInput = $(this).find('[name = "phone"]');
			var emailInput = $(this).find('[name = "email"]');

			nameInput.val($.trim(nameInput.val()));
			phoneInput.val($.trim(phoneInput.val()));
			emailInput.val($.trim(emailInput.val()));

			if(nameInput.val() != undefined){
				if(nameInput.val().length === 0)
				{
					nameInput.addClass('error');
					nameInput.focus();
					return false;
				}
			}

			if(emailInput.val() != undefined){
				var reg = /^([A-Za-z0-9_\-\.])+\@([A-Za-z0-9_\-\.])+\.([A-Za-z]{2,4})$/;
				if(emailInput.val().length === 0 || reg.test(emailInput.val()) == false)
				{
					emailInput.addClass('error');
					emailInput.focus();
					return false;
				}
			}

			if(phoneInput.val() != undefined){
				if(phoneInput.val().length === 0)
				{
					phoneInput.addClass('error');
					phoneInput.focus();
					return false;
				}
			}

			var form = $(this);
			var formData = new FormData($(this)[0]);
			var url = form.attr('action');
			$.ajax({
				type: 'POST',
				url: url,
				data: formData,
				cache: false,
				contentType: false,
				processData: false,
				async: false,
				success: function(data)
				{
					$('input').removeClass('error');
					$('input[type="text"]').val('');
					$.fancybox({
                       'autoScale': true,
                       'transitionIn': 'elastic',
                       'transitionOut': 'elastic',
                       'speedIn': 500,
                       'speedOut': 300,
                       'autoDimensions': true,
                       'centerOnScroll': true,
                       'href' : '#thanks-modal'
                    });
				},
				error: function(answer)
				{
					$('input').removeClass('error');
					$('input[type="text"]').val('');
					$.fancybox({
                       'autoScale': true,
                       'transitionIn': 'elastic',
                       'transitionOut': 'elastic',
                       'speedIn': 500,
                       'speedOut': 300,
                       'autoDimensions': true,
                       'centerOnScroll': true,
                       'href' : '#thanks-modal'
                    });
				}
			});
		};
	})(jQuery);

	//input mask

	$(function(){
		$('input[name="phone"]').mask("+38 (099) 999-9999");
	});


	// nicescroll настройки

	$("html").niceScroll({
		cursorcolor: "#c3232a",
		cursorborder: "0",
		cursoropacitymin: 0,
		cursoropacitymax: 1, 
		cursorborderradius: "2px",
		cursorwidth: "10px",
		scrollspeed: 60,
		mousescrollstep: 60,
		autohidemode: false,
		hidecursordelay: 10000,
		zindex: 9999
	});

	// настройки выпадающих списков в каталоге

	$('.need-item__more-1').click(function(){
		$(".need-item__catalog-1").toggleClass("active");
	});

	$('.need-item__more-2').click(function(){
		$(".need-item__catalog-2").toggleClass("active");
	});
	
	$('.need-item__more-3').click(function(){
		$(".need-item__catalog-3").toggleClass("active");
	});

	$('.need-item__more-4').click(function(){
		$(".need-item__catalog-4").toggleClass("active");
	});

	$('.need-item__more-5').click(function(){
		$(".need-item__catalog-5").toggleClass("active");
	});

	$('.need-item__more-6').click(function(){
		$(".need-item__catalog-6").toggleClass("active");
	});

	// настройки скрола по якорям	

	$('.go_to').click( function(){
		var scroll_el = $(this).attr('href');
		if ($(scroll_el).length != 0) {
			$('html, body').animate({ scrollTop: $(scroll_el).offset().top - 80 }, 800);
		}
    return false;
	});

	//настройки меню навигации
	
	$(window).on('scroll', function(){
		if($(document).scrollTop() > 630){
			$('.menu').addClass('active');
		}else{
			$('.menu').removeClass('active');
		}
	});

	//настройки слайдера

	$('.brand-slider').slick({
		slidesToShow: 5,
		slidesToScroll: 1,
		arrows: false,
		autoplay: false,
		dots: false,
		responsive: [{
			breakpoint: 1199,
			settings: {
				slidesToShow: 2,
				slidesToScroll: 1,
				infinite: true,
				dots: false,
				arrows: false,
				autoplay: false,
			}
		}]
	});
	
	$('.brand-slider-prev').click(function(){
		$(".brand-slider").slick("slickPrev");
	});
	$('.brand-slider-next').click(function(){
		$(".brand-slider").slick("slickNext");
	});
	
	$('.reviews-slider').slick({
		slidesToShow: 1,
		slidesToScroll: 1,
		arrows: false,
		autoplay: false,
		dots: false,
		infinite: false
	});
	
	$('.reviews-slider-prev').click(function(){
		$(".reviews-slider").slick("slickPrev");
	});
	$('.reviews-slider-next').click(function(){
		$(".reviews-slider").slick("slickNext");
	});
	
	$('.sertificates-slider').slick({
		slidesToShow: 4,
		slidesToScroll: 1,
		arrows: false,
		autoplay: false,
		dots: false,
		responsive: [{
			breakpoint: 1199,
			settings: {
				slidesToShow: 2,
				slidesToScroll: 1,
				infinite: true,
				dots: false,
				arrows: false,
				autoplay: false,
			}
		}]
	});
	
	$('.sertificates-slider-prev').click(function(){
		$(".sertificates-slider").slick("slickPrev");
	});
	$('.sertificates-slider-next').click(function(){
		$(".sertificates-slider").slick("slickNext");
	});
	
  	// настройки мобильного меню

	$('.menu-toggle').click(function(){
		$('.header-menu').slideToggle(800);
	});
	
	if($(window).width() < 768){
		$('.go_to').click( function(){
			$('.header-menu').slideUp(800);
		});
	};
	
	
	// настройки WOW	

	var wow = new WOW({
		mobile:       false,
		live:         true,
		offset: 100,
	});
	wow.init();


});
